import json

from scrapy_balloons.items import *
from scrapy_balloons.utils.prixfunctions import *
from scrapy_balloons.utils.datetimefunctions import *
from scrapy_balloons.utils.html_string import *



class coursehorse:
    @classmethod
    def product_events(self, result, field, selector, response, source):
        #form 1 : https://coursehorse.com/ballet-classes-chicago/advanced-professionial-ballet
        product_events = []
        raw_data = response.xpath("//script[contains(.,'classData')]").re("classData[= ]+(.*)(?:;)")[0]
        json_data = json.loads(raw_data)
        for i in json_data:
            e = create_event_ch(i)
            product_events.append(e)
        return product_events


def get_start_date_ch(time_epoch,objects):
    if objects:
        for i in objects:
            if time_epoch == i['start_date']:
                return i['start_date_string']
    return None

def get_end_date_ch(time_epoch,objects):
    if objects:
        for i in objects:
            if time_epoch == i['end_date']:
                return i['end_date_string']
    return None

def create_event_ch(s):
    item = ProductEvent()
    item['price_display_float'] = get_price_float(s['price_string'])
    item['price_currency'] = get_price_currency(s['price_string'])
    item['duration_filter'] = duration_filter(str(s['hours']) + ' hours')


    startdate = get_start_date_ch(s['first_class_start_datetime'],s['schedules'])
    item['start_date_local'] = startdate if startdate else s['open_date']
    item['start_date_local'] = convert_date(item['start_date_local'])


    enddate = get_end_date_ch(s['last_class_end_datetime'],s['schedules'])
    item['end_date_local'] = enddate if enddate else s['close_date']
    item['end_date_local']=convert_date(item['end_date_local'])


    item['tz'] ="UTC"
    location_display = "%s, %s %s %s %s, %s %s" % (
        s['neighborhood'], s['borough'], s['street_address1'], s['cross_streets'], s['city'], s['state'], s['zip'])
    location_display =clean_text(location_display)
    item['location_addr'] = clean_text("%s %s" %(s['street_address1'],s['cross_streets']))
    item['location_city'] = s['city']
    item['location_state'] = s['state']
    item['location_postal'] = s['zip']
    item['location_display'] = location_display
    item['location_name'] = s['neighborhood']
    item['language'] = "eng"

    # Instructor
    if 'teacher' in s and s['teacher'] is not None:
        instructor = Instructor()
        teacher = s['teacher']
        instructor['name'] = teacher['firstName'] + ' ' + teacher['lastName']
        instructor['bio'] = html_to_text(teacher['description'])
        item['instructors'] = [instructor]
    return item

